import React from "react";
import logo from "../assets/images/linkr.png";
import LeftSideLogo from "../assets/styles/LeftSideLogo.style"

export default function LeftSideLogoComponent(params) {

    const [userEmail, setUserEmail] = React.useState(0)

    return(
        <LeftSideLogo>
                <div>
                    <img src={logo} alt=""/>
                    <span>
                        save, share and discover the best links on the web
                    </span>

                    <button onClick={() => setUserEmail(userEmail+1)}>
                        {userEmail}
                    </button>


                </div>
        </LeftSideLogo>
    )
};
